import React, {useState} from "react";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Cloud(props) {
    const [isLined, setLined] = useState(false);

    function toggleLining(prev) {
        return !prev;
    }

    let cloudClass = "cloud " + props.type;
    return <Row><Col xs={{span: 4, offset: 6}}><img className ={cloudClass} src="media/cloud2.svg" alt="cloud" draggable={true} /></Col></Row>;
}

export default Cloud;
